const { sim, level, x, y } = input;

const filters = [
  {
    fieldName: "sim",
    op: "==",
    value: { ID: sim },
  },
];

if (level) {
  filters.push({
    fieldName: "level",
    op: "==",
    value: { ID: level },
  });
}

if (x !== undefined) {
  filters.push({
    fieldName: "x",
    op: "==",
    value: { INT: x },
  });
}

if (y !== undefined) {
  filters.push({
    fieldName: "y",
    op: "==",
    value: { INT: y },
  });
}

return filters;

const { cities, sim } = input;

return cities
  ? cities.map((x) => ({
      ...x,
      sim,
    }))
  : [];

const { consumables, population } = input;

return consumables.map((consumable) => {
  const { storage } = consumable;
  const minPriceBasis = consumable.minPriceBasisPct * storage.capacity;
  return {
    id: consumable.id,
    price: population / Math.max(storage.amount, minPriceBasis),
  };
});

const { population, growthRate, declineRate, ok, city } = input;

return {
  id: city.id,
  population: ok
    ? population + growthRate * population
    : population - declineRate * population,
};

const { city, cityUpdate, consumablesUpdates, withdrawals, ok };

return {
  id: city.id,
  city,
  withdrawals,
  newPopulation: cityUpdate.population,
  newPrices: consumablesUpdates,
  ok,
};

const { sim, cityReports } = input;

return {
  id: sim,
  cityReports,
  ok: !cityReports.some((x) => !x.ok),
};
